import {LOAD_PRODUCTS} from "../actions/product/action-type"

const initialState = {
    infos: {}
}

export default function ProductsReducer(state = initialState, action) {
    switch(action.type){
        case LOAD_PRODUCTS:
            return {infos: action.payload}
        break

        default:
            return state
        break
    }
}
